import React from 'react';
import '../styles/Exchanges.css';
import bitladon from '../media/images/bitladon.png';
import bittrex from '../media/images/bittrex.png';
import doveWallet from '../media/images/doveWallet.png';
import litebit from '../media/images/litebit.png';

const Exchanges = () => {
    return (
        <div className="exch__container">
            <h1 className="exch__header">Exchanges</h1>

            <div className="exch__links">
                <a href="https://www.instagram.com/oscaroneill/" rel="noreferrer noopener" target="_blank"> <img className="exch__logo" src={bitladon} alt="Bitladon" /> </a>
                <a href="https://www.instagram.com/oscaroneill/" rel="noreferrer noopener" target="_blank"> <img className="exch__logo" src={bittrex} alt="Bittrex" /> </a>
                <a href="https://www.instagram.com/oscaroneill/" rel="noreferrer noopener" target="_blank"> <img className="exch__logo" src={doveWallet} alt="Dove Wallet" /> </a>
                <a href="https://www.instagram.com/oscaroneill/" rel="noreferrer noopener" target="_blank"> <img className="exch__logo" src={litebit} alt="LiteBit" /> </a>
            </div>
        </div>
    )
}

export default Exchanges
